(function ($) {
  // mude o link aqui
  var LINK1 = 'http://combateaedes.saude.gov.br/';
  var LINK2 = 'http://combateaedes.saude.gov.br/';
  var LINK3 = 'https://www.youtube.com/watch?v=dQw4w9WgXcQ';

 
  //
  // Sai Zica - Obrigado Governo Federal
  // aedes aegypti: sou brasileiro e nao desisto nunca
  //
  var Sai_Zica = "Obrigado Governo Federal";
  var aedes_aegypti = "sou brasileiro e nao desisto nunca";


  $(window).ready(function() {
    $('head').append('<style type="text/css">.flipAE { transform: scaleX(-1); } @media (min-width: 940px) { body #aegypti-intervencao #aegypti-close { width: 42px; height: 42px; margin-left: 348px; top: 42px; left: 50%; } } #aegypti-intervencao { width: 100%; margin-top: -140px; position: fixed; top: 50%; text-align: center; } #aegypti-intervencao #aegypti-banner:focus { outline: none !important; } #aegypti-intervencao #aegypti-close { width: 4.4%; height: 12%; display: block; position: absolute; top: 12.4%; left: 87.2%; overflow: hidden; text-indent: -999999px; } #aegypti-intervencao img { width: 100%; max-width: 939px; } div#aegypti-voo { position: absolute; z-index:9999; top: -300px; left: 0px; height:300px; width:70%; } .aegypti { display: block; position:fixed; width: 60px; height: 50px; margin: 2% auto; cursor:url("https://www.brasil.gov.br/mata_moscas.cur"), default; background: url("data:image/png;base64,") left center; animation: play .2s steps(6) infinite; z-index: 10; } @keyframes play { 100% { background-position: -360px; } } .rotateAE { animation: playRotate .3s steps(4) infinite; } @keyframes playRotate { 100% { background-position: 240px; } }</style>');
    $(document).ready(function() {
      var aegyptiContent = '<div id="aegypti-voo"><a href="'+LINK1+'" target="_blank" class="aegypti"></a><a href="'+LINK2+'" target="_blank" class="aegypti"></a><a href="'+LINK3+'" target="_blank" class="aegypti"></a></div>';
      $('#barra-brasil').length ? $(aegyptiContent).insertAfter($('#barra-brasil')) : $(document.body).prepend($(aegyptiContent));

      $('.aegypti').each(function(num, el) {
        $el = $(el);
        $parent = $el.parent();
        // Randomize start point:
        $(el).css({
          top: $parent.height() * Math.random() + 'px'
        });
        animateAedes($(el));
      });
    });
  });

  function makeNewPosition($container) {
    var h = $container.height() - 50;
    var w = $container.width() - 50;

    var nh = Math.floor(Math.random() * h);
    var nw = Math.floor(Math.random() * w);

    return {
      left: nw,
      top: nh
    };
  }

  function animateAedes($target) {
    var newq = makeNewPosition($target.parent());
    var oldq = $target.offset();
    var origAngle = $target[0].angle || 0;
    var angle = ((Math.atan2(newq.top - oldq.top, newq.left - oldq.left) / Math.PI) * 180) - 90;

    // .flipAE é animaç no sentido contrario, usar somente .aegypti énimaç sentido normal
    // .rotateAE sã4 frames para rotaç, deve reproduzir somente no limite/retorno 
    for (var step = 0; step <= 1; step += .1) {
      setTimeout(function() {
        $target.removeClass('aegypti flipAE').addClass('aegypti')
      }, 50 * step);
      (function(stepAngle) {
        setTimeout(function() {
          $target.removeClass('aegypti rotateAE').addClass('aegypti flipAE')
        }, 50 * step);
      })($target.removeClass('aegypti flipAE').addClass('aegypti rotateAE'), 300 * step);
    }

    var speed = calcSpeed(oldq, newq);

    $target.animate({
      left: newq.left,
      top: newq.top
    }, speed, function() {
      setTimeout(function() {
        animateAedes($target)
      }, 500);
    });
  }

  function calcSpeed(prev, next) {
    var x = Math.abs(prev.left - next.left);
    var y = Math.abs(prev.top - next.top);
    var dist = Math.sqrt(x * x + y * y);

    return Math.log(dist / 10 + 1) * 900;
  }

}(jQuery));

